import axios from "axios";

const url = "https://api.github.com/users/";

const Fetch = async (username) => {
  let changeableurl = url;

  if (username) {
    changeableurl = `${url}/${username}`;
  }

  try {
    const data = await axios.get(changeableurl);
    console.log(data);
  } catch (error) {
    console.log(error);
  }
};

export default Fetch;
